import React, { Component } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import { Table } from "react-bootstrap";
import Footer from "./Footer";

export default class Profile extends Component { // Start
  // Constructor
  constructor(props) {
    super(props);

    this.state = {
      items: [],
      DataisLoaded: false,
    };
  }

  // ComponentDidMount is used to
  // execute the code
  componentDidMount() {
    fetch("http://localhost:9093/user/allusers")
      .then((res) => res.json())
      .then((json) => {
        this.setState({
          items: json,
          DataisLoaded: true,
        });
      });
  }

  //End

  render() {
    const { DataisLoaded, items } = this.state;

    return (
      <>
        <div>
          
          <Table striped bordered hover variant="dark">
            <thead>
              <tr className="text-centre">
                <th>Id</th>
                <th>Name</th>
                <th>Username</th>
                <th>Contact</th>
                <th>Email</th>
              </tr>
            </thead>
          </Table>
        </div>
        {items.map((item) => (
          <div className="container">
            <div className="row">
              <div className="card">
                <div className="card-header cardheader">
                <label><b>{item.name}</b></label>
                

                </div>
                <div className="card-body">
                <label>{item.id}</label>
                <label>{item.username}</label>
                <label>{item.contactno}</label>
                <label>{item.email}</label>
                

                </div>

              </div>



            </div>

           
            {/* <Table striped bordered hover variant="dark">
              <tbody>
                <tr className = "card">
                  <td>{item.id}</td>
                  <td>{item.name}</td>
                  <td>{item.username}</td>
                  <td>{item.contactno}</td>
                  <td>{item.email}</td>
                 
                </tr>
              </tbody>
            </Table> */}
          </div>
        ))}

        <div>
          <Footer />
        </div>
      </>
    );
  }
}
